import React from "react";
import { Box } from "@mui/material";
import ChatHeader from "./ChatHeader";
import Messages from "./Messages";

const ChatBox=()=>{
    return (
        <Box>
            <Box>
                <ChatHeader />
            </Box>
            <Box>
                <Messages />
            </Box>
        </Box>
    );
}

export default ChatBox;
